                <div className="row bg-warning">description</div>
                <div className="row bg-danger">description2</div>
                <div className="row bg-info">
                    <div className="col-md-6 bg-warning">thanksto</div>
                    <div className="col-md-6 bg-success">button</div>
                </div>
            </div>
        )
    }
}

export default RollItem;

<div className="card-list">
{this.state.data.map((item, idx) => (
    <Card2 
    key={idx} 
    image={item.pic}
    title={item.title} 
    hashtag={item.category}
    description={item.description}
    description2={item.description2}
    thanksto={item.thanksto}
    url={item.url}
    />
))}
</div>
